import './App.css';
import MenuBox from './components/MenuBox';
import Head from './components/Head';

import { useState } from 'react';

function App() {

  const [search, setSearch] = useState("");

    const SearchChange = (e) => {
      setSearch(e.target.value);
    }

  return (
    <div className="Wrap">
      <Head></Head>
      <div className='Search'>
        <span className='Searchst'> 이름 검색:</span>
        <div className='Searchmerge'>
          <input type='text' value={search}  id="SearchInput" placeholder="검색어 입력" onChange={SearchChange}></input>
          <img className='Searchicon' src="https://s3.ap-northeast-2.amazonaws.com/cdn.wecode.co.kr/icon/search.png" alt={logo} />
        </div>
      </div>
      <MenuBox search={search}></MenuBox>
    </div>



  );
}

export default App;
